import React, { useEffect, useState } from "react";
import Layout from "../../common/layout";
import { useTranslation } from "react-i18next";
import { Container } from "../../common/layout/styels";
import Tabs from "../../../elements/tab";
import Today from "./today";
import Board from "./board";
const Attendance = () => {
  const [t] = useTranslation();
  useEffect(() => {
    document.title = `${t("attendance")} - VSH Security`;
  }, [t]);
  const [tabs] = useState([
    { name: "board", title: "On Work", element: <Board /> },
    { name: "today", title: "Today", element: <Today /> },
    { name: "yesterday", title: "Yesterday", element: <Today /> },
    { name: "week", title: "Week", element: <Today /> },
    { name: "month", title: "Month", element: <Today /> },
  ]);

  return (
    <Container className="noshadow">
      <Tabs tabs={tabs}></Tabs>
    </Container>
  );
};
// exporting the page with parent container layout..
export default Layout(Attendance);
